I do this all the time. I think back and wonder where I’d be today if I hadn’t made some of the decisions I have.
I wonder where I’d be living, where I’d be working, what I’d be doing.
But then I look around me and ask myself if I’d make the same choices. And the answer is ALWAYS yes.

Before I found out I was pregnant with Ted I had been accepted into Unitec, onto a course I had been dreaming about for years. A course I know isn’t easy to get into, and the interview process was hard.
I was so ready to get my life together and go after my new career. And then just a few weeks after getting accepted, I find out about Ted.
It was the most excruciating, but easiest decision I’ve made.
Whether I continue study and give up Teddy.
Whether I study and cope with having a newborn in the middle of the school year as a single mother.
Or weather I put my dream on hold to pursue motherhood - something I wasn’t sure could happen for me.

Making the decision to put my career and dreams on hold is something I will never ever regret, and one I would make time and time again.
Every time I look into Teds beautiful big eyes, I see my hopes, dreams and future in him and I know I made the right decision.
.
